insert into course values('THEA','1110','Theatre Appreciation','3','Surveys the contributions of performers, designers, and playwrights to a theater production. The audience as co-author of the theater event is also examined. The customary sequence involved in producing a play will be discussed. Information will also be presented about audiences, theaters, performers, and the conventions of the theater of several eras. Lab fee required. (3-0-3)');
