insert into course values('ARTC','1100','Art Appreciation','3','This illustrated lecture course deals with ideas and images that introduce basic art theory, art practice, and art history. The student will explore the concept "art"; media and methods used by artists; and analyze compositional elements and design principles employed by artists in the creation of their work. (3-0-3)');
insert into course values('MUSC','1100','Music Appreciation','3','Introduction to music listening and literature. A study of traditional forms of music from ancient times to the present with emphasis on the basic elements of music and their relationship. This study emphasizes the development of listening skills and musical understanding. (3-0-3)');
