insert into course values('BIOL','1107','Essentials of Biology I','3','Essentials of Biology 1. The first of a 2-semester sequence which provides a survey of the principles of modern biology. BIOL 1107 includes cell structure and function, cellular respiration and photosynthesis, gene structure and function, genetics, and evolution. The course satisfies Core Area D non-laboratory science option only, unless taken concurrently with BIOL 1107L, Essentials of Biology Laboratory. Taught Fall Semester and Spring Semester. (3-0-3)');
