insert into course values('CHEM','1212','Principles of Chemistry II','3','Second course in a two-semester sequence covering the fundamental principles and applications of chemistry for science majors. Specific topics that will be covered in this course include: states of matter, solution chemistry and equilibria, acid-base chemistry, thermodynamics, electrochemistry, and nuclear chemistry. (3-0-3)');
