insert into course values('PHYS','1112','Introduction to Physics II','4','Emphasizes classical electromagnetism, optics, and modern concepts, including relativity, quantum mechanics, and atomic and nuclear structure. (3-3-4)');
insert into course values('BIOL','1108','Essentials of Biology II','3','Essentials of Biology 2. The second of a 2-semester sequence which provides a survey of the principles of modern biology. BIOL 1108 includes the diversity of living things, plants & animal systems, and ecology. The course satisfies Core Area D non-laboratory science option only, unless taken concurrently with BIOL 1108L, Essentials of Biology Laboratory. Taught Fall Semester and Spring Semester. (3-0-3)');
