insert into course values('POLS','1101','American Government','3','American political institutions and processes and their development over time are carefully examined in this course. A passing grade in this course satisfies the U.S. and Georgia Constitution requirements of Georgia StateCode 20-3-68. (3-0-3)');
insert into course values('HIST','1111','World Civilization I','3','A survey of world history to early modern times. This section is for students participating in the GSW Honors Program. (3-0-3)');
insert into course values('HIST','1112','World Civilization II','3','This course surveys world history from early modern times to the present. May be taken before HIST 1111. (3-0-3)');
insert into course values('HIST','2111','United States History I','3','This course focuses on American history from the discovery of the Western World through the Civil War. A passing grade in this course satisfies the U.S. history and Georgia history requirements of Georgia State Code 20-3-68. (3-0-3)');
insert into course values('HIST','2112','United States History II','3','This course focuses on American history from Reconstruction to the present. A passing grade in this course satisfies the U.S. history and Georgia history requirements of Georgia Code 20-3-68. (3-0-3)');
insert into course values('ECON','2105','Principles of Macroeconomics','3','This principles of economics course is intended to introduce students to concepts that will enable them to understand and analyze economic aggregates and evaluate economic policies. (3-0-3)');
insert into course values('SOCI','1101','Introduction to Sociology','3','A general analysis of human social behavior, culture, social groups, and social institutions. (3-0-3)');
insert into course values('PSYC','1101','Introduction to Psychology','3','A survey of the scientific discipline of psychology, including the approach used to address key issues. Emphasis is placed on heredity, environment, emotions, motives, learning and intelligence as related to individual differences. This course serves as a prerequisite for advanced courses in psychology. (3-0-3)');
insert into course values('CSCI','1301','Introduction to Programming I','4','The emphasis in this course is on problem solving and basic programming. A high-level language will be used to explain programming structure and style. Topics will include problem solving and algorithm development, data types, operators, methods, control structures, arrays, and program design. (4-0-4)');
insert into course values('CSCI','1302','Introduction to Programming II','4','This course is a continuation of the Introduction to Programming I class using the C#.NET programming language. Topics to be covered include arrays and collections, windows programming, event based programming, handling exceptions, and working with files and databases. (4-0-4)');
insert into course values('CSCI','2100','Assembly Language Programming','3','This course discusses the basic computer organization of the microcomputer and its assembly programming language, Assembly fundamentals, Macro Assembler, DEBUG, I/O services, numeric processing and conversion, string processing. Macro library, and Macro structures will be covered. (3-0-3)');
insert into course values('CSCI','2500','Discrete Structures','3','This course provides a brief introduction to mathematical logic and typical proof methods, followed by a discussion of sets, function, and relations. The course also focuses on the mathematical techniques that are frequently used in computer science like counting techniques, combinatorics, and recurrence relation. (3-0-3)');
insert into course values('MATH','2221','Calculus II','4','This is a continuation of Calculus I. It deals with further applications of one variable integration, the techniques of integration, sequences, series, indeterminant forms and improper integrals. Technology, in the form of graphing calculators and modeling software, will be integrated in the course. (4-0-4)');
insert into course values('PEDS','1010','Lifetime Fitness','1','A course required of all students as a part of the general curriculum. The purpose of the course is to provide the student with scientific-based knowledge concerning practical application of physical fitness training and evaluation procedures while participating in a fitness program. (0-2-1)');
insert into course values('PEDS','2000','CPR and First Aid','2','This course is required of all students as part of the general curriculum. The course is designed to provide every student knowledge and practical skill practice in a current first aid, cardiopulmonary resuscitation techniques and HIV/AIDS education. (1-1-2)');
insert into course values('PEDS','1020','Aerobics - Walk-Jog','1','This course is designed to equip students with the necessary information and practical learning experiences to design, implement, and evaluate their own personal aerobics exercise program. (0-2-1)');
insert into course values('PEDS','1030','Step Aerobics','1','This course is designed to equip students with the necessary information and practical learning experiences to design, implement, and evaluate their own personal step aerobics exercise program. Emphasis will be placed on safety, body mechanics and proper usage of the step. (0-2-1)');
insert into course values('PEDS','1100','Beg Swimming','1','To equip students with basic safety and knowledge to make them reasonably safe while in or about water. (0-2-1)');
insert into course values('PEDS','1230','Racquetball','1','The purpose of the course is to provide the beginning student with the skills and knowledge needed to play and understand the game of racquetball. (0-2-1)');
insert into course values('PEDS','1250','Beg Tennis','1','To equip the student with basic skills knowledge so that they may establish an interest and desire to play tennis. (0-2-1)');
insert into course values('PEDS','1330','Weight Training','1','Fundamental techniques in developing fitness and conditioning with the idea of developing firm, healthy-looking bodies naturally from the facilities and equipment available. (0-2-1)');
insert into course values('PEDS','1700','Fundamentals of Dance','1','A study of the fundamental skills and knowledge needed to perform ballroom, square and folk dance steps and patterns. (0-2-1)');
insert into course values('PEDS','1910','Beg Yoga','1','The purpose of the course is to provide the beginning students with the skills and knowledge needed to practice yoga on their own. (0-2-1)');
insert into course values('CIS','3000','Internet Technologies','3','The course is an introduction to the essential concepts of HTML and JavaScript. It provides a comprehensive introduction to the tools and skills required for both client- and server-side programming, teaching students how to develop platform-independent sites using a manageable progression. Other concepts relating to client-side and server-side programming, including ASP.NET using C#, JavaScript, Ajax, JSP, XHTML, XML, Ruby, Rails, Flash and PHP are also introduced. (3-0-3)');
insert into course values('CIS','4200','Computer Security','3','This course provides an introduction to various topics of computer and information security, including but not limited to: cryptography, access control, authentication, vulnerability analysis, network security, and intrusion detection. Students will strengthen their understanding of basic security issues through a series of hands-on projects. (3-0-3)');
insert into course values('CSCI','2920','Ethics in the Comp Profession','1','This course covers ethical theory and codes of ethics for computer professionals. It covers topics such as the responsibility and liability of software creators and software vendors, computers and privacy, computers and the distribution of power in our society, and ownership of software. (1-0-1)');
insert into course values('CSCI','3100','Introduction to Computer Org','3','This course introduces students to the fundaments of digital logic design. It covers basic combinational and sequential logic components and the design of combinational and sequential circuits. It also introduces block-level design of complex functions, ALU design, control unit design and instruction set design. (3-0-3)');
insert into course values('CSCI','3200','UNIX','3','The goal of this course is to provide knowledge of UNIX applications interface, guiding the student through operating system utilities including process, file, storage and I/O management. Cover important UNIX concepts, like interprocess communication and I/O redirection with shell commands to enhance understanding of both and to discuss Bourne and C Shell Programming. (3-0-3)');
insert into course values('CSCI','3300','Concepts of Programming Lang','3','The course provides an introduction to the basic paradigms and techniques of imperative, functional, logic, objectoriented, and concurrent programming languages. Using illustrative examples, the student will be exposed to various programming languages representative of the above paradigms. (3-0-3)');
insert into course values('CSCI','3500','Data Structures and Algorithms','3','This course covers the basic data structures including stacks, queues, linked lists, heaps, and various search trees, utilizing the abstract data type approach. Recursive algorithms, and search and hashing techniques are discussed. Sorting and searching algorithms are analyzed for space and time complexities. (3-0-3)');
insert into course values('CSCI','4100','Computer Architecture','3','This course covers the basic concepts and design issues in the hardware design and computer systems. Block level design issues, data processing unit design, instruction set design, RISC vs. CISC issues, hardwired and microprogrammed control unit design, memory organization, the system bus structure, IO processors and DMA / Interrupts are also discussed. (3-0-3)');
insert into course values('CSCI','4200','Design of Operating Systems','3','This course introduces the general principles of designing and implementing an operating system. Topics include memory management, processor management, process synchronization, device management, and file systems.');
insert into course values('CSCI','4300','Software Engineering','3','This course introduces basic software engineering principles. The course will discuss the scope of software engineering, software process, life cycle models, team organizations, testing, introduction to objects, and phases of software life cycle. Students will learn how to implement the basic software engineering principles via real life scenarios. Topics include engineering life-cycle models, the software process, object-oriented analysis, writing functional specifications and software maintenance. (3-0-3)');
insert into course values('CSCI','4310','Object Oriented Programming','3','The important features of objects such as inheritance, interfaces, and polymorphism will be introduced. Specific topics include systematic approach to program construction, preconditions, postconditions, and object-oriented design case studies. The students will be required to run a significant number of programs in an object-oriented programming language. (3-0-3)');
insert into course values('CSCI','4400','Intro to Database Systems','3','This course will discuss the fundamental concepts necessary for the design, use and implementation of database systems. The topics include the relational model, the ER, SQL, functional dependencies, normalization, and relational design. (3-0-3)');
insert into course values('CSCI','4500','Design-Analysis of Algorithms','3','This course provides techniques for designing and analyzing algorithms. It covers various types of efficiency analysis including worst-case, average, and amortized complexity. It also presents the main paradigms in the design of algorithms (greedy, divide-and-conquer, dynamic programming, backtracking) for the main classes of algorithms. (3-0-3)');
insert into course values('CSCI','4910','Junior-Senior Seminar','1','This course allows students to select and explore topics from a wide spectrum of topics in the computing field and to make a class presentation on this topic. Students will gain experience in preparing and delivering a presentation to an audience of peers and in the critical evaluation of presentations. (1-0-1)');
insert into course values('CSCI','4940','Capstone Project','3','This project oriented course is intended for students who are nearing the end of their B.S. Degree in Computer Science or Information Technology. The purpose of this course is to provide a complex examination and review of various ideas and issues across the broad areas of computer science via hands-on projects. Student will develop interpersonal and team-working skills in this course. (1-2-3) Prerequisite: The student must be in the senior status.');
insert into course values('CIS','3300','Systems Anal Des-Implem I','3','This course provides the students with an introduction to technical and management issues in systems analysis and design. The course covers various issues such as the SDLC model, CASE tools, the systems analyst and the different roles of a systems analyst in an organization. It introduces students to various information gathering techniques, tools for project management, CPM, PERT charts, issues and models for sampling data sources, ER diagrams, data flow diagrams and data dictionaries. It includes an in-depth treatment of prototyping, the role of the user in prototyping and other issues related to prototyping. (3-0-3)');
insert into course values('CIS','4310','Information Sys Project Mgmt','3','This course provides background knowledge in information technology project management. The course covers several aspects of project management such as project integration management, scope management, time, cost, risk management, project quality management, and human resource management. Students will have hands-on experience in using project management software such as MS Project 2007. (3-0-3)');
insert into course values('CIS','4400','Information Storage-Retrieval','3','This course will discuss the data structures, techniques and algorithms needed to build information retrieval systems. Topics will include conceptual models of Information retrieval, text operations, query languages and operations, retrieval evaluation, indexing and searching, user interface and visualization. (3-0-3)');
insert into course values('CSCI','4210','Data Comm-Computer Networks','3','This course covers elementary communications theory, fundamental communication concepts, layered protocols, network switching, distributed processing, error detection and correction, routing algorithms, network security, topology, and management. (3-0-3)');
insert into course values('CSCI','4320','Human Computer Interaction','3','This course will discuss interactive systems, human user, channels of communication; theories of human memory; variability and limits of human capabilities; theories of human reasoning and problem-solving, tasks and strategies, interactive devices and technologies, design of interfaces, dialogue design and styles; new ideas in interfaces, tools and techniques for the construction of interfaces, and methods of evaluation. (3-0-3)');
insert into course values('CSCI','4510','Theory of Computation','3','The course investigates the fundamental capabilities and limitations of computers. It covers finite automata, regular languages and sets, context-free grammars, pushdown automata, and Turing machines. (3-0-3)');
insert into course values('CSCI','4820','Principles of ComputerGraphics','3','The course will cover the basic principles of two dimensional graphic display, algorithms, and modeling. The purpose of this course is to present a theoretical understanding of elementary graphics rather than the use of a particular graphical programming language. Topics include extensive discussion of simple graphics primitives (lines, curves, polygons, etc.), polygon filling, color, and brushes. Software libraries in an appropriate language will be used to implement class discussions. Display of three-dimensional objects is introduced. (3-0-3)');
insert into course values('CSCI','4830','Artificial Intelligence','3','This course provides an introduction to the problems and techniques of Artificial Intelligence. It surveys the major subdisciplines of AI discussing such topics as problem spaces, search strategies, game theory with minimax and alpha-beta pruning, knowledge representation, machine learning, neural networks, and intelligent agents. An appropriate language for AI programming will be introduced. (3-0-3)');
insert into course values('CSCI','4930','Internship','3','The Internship gives students an opportunity to apply and extend the theoretical knowledge acquired in the classroom to a practical experience. Topics for the internship projects are based on the undergraduate curriculum. (0-12-3) Senior status');
insert into course values('CSCI','4900','Special Problems in Comp Sci','3','This course provides students with an opportunity to study and explore current computer science topics not covered in any other course. Students will also have the opportunity to design and implement software systems for business environments and to expand on projects from previous classes. (3-0-3) Junior status or above');
insert into course values('CIS','4900','Special Problems in CIS','3','This course provides students with an opportunity to study and explore current computer information systems topics not covered in any other course. Students will also have the opportunity to design and implement software systems for business environments and to expand on projects from previous classes. (3-0-3) Junior status or above');
insert into course values('MATH','2204','Elementary Statistics','3','The study of the nature of statistics, the fundamental concepts of probability, the methods of collecting and analyzing data, and the techniques of making inferences based upon data. Technology, in the form of graphing calculators and statistical software, will be integrated in the course. (3-0-3)');
insert into course values('MATH','2222','Calculus III','4','This is a continuation of Calculus II. It introduces students to the notions of vector calculus commonly used in engineering and science applications: vector and scalar functions of several variables, gradients, curl and divergence, mini-max theorems, multiple integrals, line integrals, the theorems of Green, Gauss and Stokes, and their applications. Technology in the form of graphing calculators and modeling software, will be integrated in the course. (4-0-4)');
insert into course values('MATH','2223','Discrete Systems I','3','A course designed to give students an introduction to discrete models, in the context of finite dimensional linear algebra, with applications. (3-0-3)');
insert into course values('MATH','3313','Differential Equations','3','This course provides students of mathematics, science and pre-engineering with a qualitative, numeric and analytic approach to the dynamical systems commonly encountered in their disciplines. (3-0-3)');
insert into course values('MATH','3320','Scientific Computation','3','An introduction to the elements of modern scientific computing, using visualization, vector-level thinking skills, numeric models, and analytic techniques. (3-0-3)');
insert into course values('MATH','3322','Adv Mathematical Modeling','3','Teaches the art of mathematical modeling and the techniques of validation in deterministic and stochastic settings. (3-0-3)');
insert into course values('MATH','3325','Mathematical Statistics','3','A course designed to give students of mathematics, computer science, the physical sciences, and pre-engineering a reasoned introduction to probability and statistics using the multivariable calculus. (3-0-3)');
insert into course values('CSCI','5120','Topics in Information Security','3','Complete examination of the issues and problems in providing security for information processing systems, security goals and vulnerabilities, encryption and decryption, secure general purpose operating systems and applications, network security, Digital Signatures and Public Key Cryptosystems, security protocols, etc. (3-0-3)');
insert into course values('CIS','6720','Distributed Web Applications','3','This course will demonstrate a new approach in the distributed web applications field, cloud computing. The first part of the course is devoted to main concepts of cloud computing. In the second part, students will learn contemporary models for development of distributed web applications. The last part is devoted to practical work in a could computing environment. (3-0-3)');
insert into course values('CSCI','6230','Internet Architect-Protocols','3','This course deals with the principles and issues underlying the provision of wide area connectivity through the interconnection of autonomous networks. Detailed discussion of the problems and solution techniques that arise in internetworking. Emphasis will be placed on the Internet architecture and protocols. (3-0-3)');
insert into course values('CSCI','6410','Adv Database Design','3','This course will discuss emerging advanced database technology to prepare the students with currently practiced database tools in the industry. Students will do comparative study of different database systems. The course will also discuss design, development, and implementation strategies involving databases, database security, and database administration. (3-0-3)');
insert into course values('CIS','6800','Human-Comp Interact-Intf Des','3','This course will discuss interface design between the user and computer, user capabilities and limitations; designing systems for people, evaluation and testing of systems; usability engineering, and ergonomics. At the center of the course is the development of a hands-on semester project that will help students learn about various stages of an effective design process. (3-0-3)');
insert into course values('CSCI','6220','Distributed Operating Systems','3','This course will cover taxonomy of distributed systems and distributed operating systems. Topics will include mutual exclusion, atomic transaction, deadlock handling, threads, processor allocation, scheduling, distributed file systems, distributed shared memory, and system programming issues in distributed systems.(3-0-3)');
insert into course values('CIS','6420','Data Mining','3','This course is aimed at preparing students with a comprehensive look at the concepts and techniques needed to discover new knowledge from business data. It includes several methods of data mining, provides in-depth coverage of essential data mining topics including OLAP and data warehousing, data processing, concept description, association rules, classification and prediction, and analysis.(3-0-3)');
insert into course values('CIS','5310','Decision Support Systems','3','This course concentrates in the use of computer systems to help and assist in the decision making process. It will start with analyzing the process of making a decision and the role of a decision maker. This course examines a set of information systems which support decision makers: individual and group decision support systems, expert systems, and neural networks. It discusses the development, implementation, and application of these systems. To understand how DSS are built, several areas and tools of modeling and artificial intelligence will be considered. (3-0-3)');
insert into course values('CSCI','6320','Adv Software Engineering','3','This course expands on and goes beyond concepts learned in the undergraduate level software engineering course. Its goal is to arm students with a professional level knowledgebase sufficient for architecting, managing, and implementing all aspects of current software engineering practices. Along with providing advanced fundamentals, this course discusses and critiques published peer-reviewed white papers related to various aspects of the software engineering discipline. Real-world scenarios and commercial practices are analyzed andexercised during a term project. (3-0-3)');
insert into course values('CSCI','6821','Adv Computer Graphics','3','This course is an exposition of the techniques needed to generate and render three-dimensional computer images. It will provide a theoretical understanding of these techniques together with the programming expertise required to implement them. Two-dimensional graphics will be reviewed in detail. Homogeneous (4-coordinate) representation of three-dimensional points and vectors are presented with matrix transformations for orthographic and perspective projection. (3-0-3)');
insert into course values('CSCI','6900','Special Problems in CS','3','This course provides students with an opportunity to study and explore current computer science topics not covered in any other course. Students will also have an opportunity to design and implement software systems for business environments and to expand on projects from previous classes. (3-0-3)');
insert into course values('CIS','6900','Special Problems in CIS','3','This course provides students with an opportunity to study and explore current computer information systems topics not covered in any other course. Students will also have the opportunity to design and implement software systems for business environments and to expand on projects from previous classes. (3-0-3)');
insert into course values('CSCI','6930','Internship','3','The Internship gives students an opportunity to apply and extend the theoretical knowledge acquired in the classroom to a practical experience. Topics for the internship projects should be based on the graduate curriculum. (0-12-3)');
